import React from "react";
import './nav.css';
import { Link } from "react-router-dom";

 const NavBar = () => {
  const dispatch =useDispatch()
  const pokemones=useSelector(store=>store.pokemons)
  return (
    <nav className="caja-de-navbar">
            <ul className="botones"><Link onClick={()=>dispatch(getPokemon())} to="/"><h2>Pokedex</h2></Link></ul>
            <ul className="botones"><Link  to="/create"><h2>Create</h2></Link></ul>
            <ul className="botones"><Link  to="/team"><h2>My team</h2></Link></ul>
      
    </nav>
  );
};
export default NavBar;
